```python
import numpy as np

def distance_to_nearest_0(matrix):
    distance_to_nearest_0 = np.zeros((len(matrix), 1))
    for i in range(len(matrix)):
        for j in range(len(matrix[0])):
            if matrix[i][j] == 0:
                distance_to_nearest_0[i] = 0
    return distance_to_nearest_0
